// src/components/Test.js
import React, { useEffect, useState } from 'react';
import { getQuestions } from '../api'; // Ensure this function is defined to fetch questions

const Test = () => {
    const [questions, setQuestions] = useState([]);
    const [error, setError] = useState('');

    useEffect(() => {
        const fetchQuestions = async () => {
            try {
                const response = await getQuestions(); // Ensure this API call is correct
                if (response && response.length > 0) {
                    setQuestions(response);
                } else {
                    setError('No questions available');
                }
            } catch (err) {
                console.error('Failed to fetch questions:', err);
                setError('Failed to fetch questions');
            }
        };

        fetchQuestions();
    }, []);

    if (error) {
        return <div>{error}</div>; // Display error if there is one
    }

    return (
        <div>
            {questions.map((question, index) => (
                <div key={index}>
                    <h4>{question.questionText}</h4>
                    {/* Add more question rendering logic here */}
                </div>
            ))}
        </div>
    );
};

export default Test;
